import React, { Component } from 'react'
import './footer_style.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee, faFacebook } from '@fortawesome/free-solid-svg-icons';



export class Footer extends Component {
  render() {
    return (
        <div class="fixed_footer">
        <h2 id="footer_1">Sticky Footer</h2>
        <h2 id="footer_2">Sticky Footer</h2>
        <h2 id="footer_3">Sticky Footer</h2>
        <FontAwesomeIcon icon="fa-brands fa-facebook" style={{color: "#ff0000",}} />
        
    </div>
    )
  }
}

export default Footer
